Dieu 21. To chirc, nhiém vu va quyen han cua don vi dao tao

1. Thu truong don vi dao tao thanh lap HDTS theo ting hinh thtrc dao tao

dé diéu hanh cdc céng viéc lién quan dén cong tac tuyén sinh cua don vi;

2. Thanh phan cua HBTS gém cé:

a) Chu tich: Dai dién lanh dao don vi;

b) Pho Chi tich: Cap pho lanh dao don vi;

c) Uy vién thuong truc: Truong phong Dao tao/Ph6 truéng phong Dao tao;

d) Cac uy vién: Mét sé truéng phong, truéng khoa, trudéng b6 mén va can
b6 cong nghé thong tin, can bo phu trach céng tac tuyén sinh cua don vi;

Nhieng nguéi cé nguodi than (con, vo/chong, anh, chi, em ruét cia minh va
cua chong/vo) dv thi hay dang ky xét tuyén vao don vi khéng duoc tham gia HBTS
va cdc tiéu ban gitp viéc HDTS ctia don vi trong nam tuyén sinh.

